import React, {Component} from 'react';
import {BrowserRouter} from 'react-router-dom';
import {
	BrowserRouter as Router,
	Route,
	Switch,
	Link,
	Redirect
} from "react-router-dom";

import Landingpage from './components/Pages/LandingPage';


class App extends Component {
	render() {
 		return (
  			<BrowserRouter>
    			<div className="App">
    				<Landingpage />


    			</div>
    		</BrowserRouter>

  		);
	}
}

export default App;
